window.bookSummaryJSON = "<p><b>After traversing the dangerous Dead Zone, Zac has finally managed to save his sister and bring her back to Port Atwood.</b></p> <p>But Zac knows he can't relax. Not if he wants to keep her safe. The foreign factions keep spreading their influence, and ancient foes have set their sights on Earth.</p> <p>With his newfound abilities, Zac has joined the Limited Hunt to gain the strength needed to protect his family and his world.</p> <p>However, the System is unwilling to let Zac train in peace, and the hunt is not what it seems...</p> <p><b>Don't miss Book Three of the hit Defiance of the Fall LitRPG series with over 20 ,illion views on Royal Road.</b></p> <p><b>About the series: </b>Jump into a story that merges LitRPG elements with eastern cultivation. Class systems, skill systems, endless choices for progression, it has everything fans of the genre love. Explore a vast universe full of mystery, adventure, danger and even aliens; where even a random passer-by might hold the power of a god. Follow Zac as he struggles to stake out a unique path to power as a mortal in a world full of cultivators.</p>"; 
